import React from 'react';
import { Container, Header, Menu } from 'semantic-ui-react';

const ResultPage = () => {
    const [visualState, setVisualState] = React.useState('coop')

    const handleClick = (event, {name}) => {
        setVisualState(name)
    }

    return <Container>
        <Header as='h2'>Results of LSTM Training</Header>
        <Header as='h2'>Results of Q-Table Training</Header>
        <Menu fluid pointing secondary>
            <Menu.Item
                name='coop'
                active={visualState === 'coop'}
                onClick={handleClick}
            />
            <Menu.Item
                name='defect'
                active={visualState === 'defect'}
                onClick={handlemClick}
            />
            <Menu.Item
                name='copy'
                active={visualState === 'copy'}
                onClick={handleClick}
            />
            <Menu.Item
                name='grudge'
                active={visualState === 'grudge'}
                onClick={handleClick}
            />
        </Menu>
    </Container>
}

export default ResultPage;
